import React from 'react';

import 'antd/dist/antd.css';
import './App.css';

import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom' 
import OARBeli from './components/OARBeli';
import OARBeliAdd from './components/OARBeliAdd.jsx';

function App() {
  const App = () => {
    return (
        <Router>
          <div className="App">
            <nav>
              <ul>
                <li>
                  <Link to='/OARBeli'>OARBeli</Link>
                </li>
              </ul>
            </nav>

            <Switch>
              <Route path='/OARBeli' component={OARBeli}/>
            </Switch>
          </div>
        </Router>
    );
  }

  return (
      <App />
  );
}


export default App;
